  [],\n\t\"revision_timestamp\": \"2015-05-07T01:23:03.768613\",\n\t\"name\": \"hd6d-lidar-for-high-speed-descent-mapping-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Systems &amp; Processes Engineering Corporation
  (SPEC) and Texas A&amp;M University (TAMU) propose a space hardened, compact, low
  power, high definition six-dimension (HD6D) LADAR for remote sensing. This modular
  situation awareness HD6D LADAR can be configured by platform and mission to support
  operational ranges from 8km to 30 km, while meeting CubeSat form factors of .5U
  to 3U, respectively. The .5U CubeSat configuration has a 3.2Mpps HD6D Micro-LIDAR
  with integrated high resolution, 5 Mpixel, 30fps, RGB camera and can achieve a 4km
  effective range in single pulse mode or 8km range in integrated image mode (for
  0.1 reflectivity targets). The long range Gen IV HD6D configuration can be used
  for descent imaging.  It has a 12.8Gig pixels per second acquisition rate, 100x
  faster than competitors, and a clear air range of 20km.  Current Gen IV LIDARs have
  a 30 degree field of view, using pixel sizes of 0.7mr or 0.15mr.  Built around the
  space qualified Vertex-5QV FPGA, using pipeline processing to calculate the stabilized
  x,y,z amplitude point cloud, merges the point cloud with the RGB image, and produces
  HD6D binned images (x,y,z,R,G,B).  The LIDARs have range accuracy of 3mm at close
  range, 35mm at acquisition ranges.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
